  null,\n\t\"notes\": \"This dataset contains information regarding the capture, tagging
  and re-sighting of northern fur seals on the Pribilof Islands and Bogoslof Island,
  Alaska, from 1986 to the present. Tagged fur seals are seen and documented during
  land-based searches at breeding and haulout beaches, primarily from July-October
  on the Pribilof Islands since 2007, using binoculars, spotting scopes and telephoto
  photography.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
